import React from 'react';
import Header from './Header_profile';

const StudentProfile = () => {
  return (
    <div>
      <Header user="student" />
      <h1>Student Profile</h1>
      <p>Details about the student will go here...</p>
    </div>
  );
};

export default StudentProfile;
